import React from 'react';
import { useLocation } from 'react-router-dom';

function Checkout() {
  const location = useLocation();
  const { cart } = location.state || { cart: [] };

  return (
    <div>
      <h1>Checkout</h1>
      {cart.length === 0 ? (
        <p>Carrinho vazio</p>
      ) : (
        <ul>
          {cart.map((product, index) => (
            <li key={index}>
              {product.name} - R${product.price}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Checkout;
